Consider the lines \begin{align*}
y&=3x+5 \\ 2y&=4x+5 \\ 3y&=9x-2 \\ 2y&=x-3 \\ 4y&=x-5.
\end{align*}Let's say that a pair of lines is $\emph{good}$ if the two lines are either parallel or perpendicular to each other.  Among all the pairs of lines shown, how many pairs are good?

Let \[f(x) = \left\{
\begin{array}{cl}
-x + 3 & \text{if } x \le 0, \\
2x - 5 & \text{if } x > 0.
\end{array}
\right.\]How many solutions does the equation $f(f(x)) = 4$ have?

If $ a$, $ b$, $ c$, $ d$, and $ e$ are constants such that every $ x > 0$ satisfies
\[ \frac{5x^4 - 8x^3 + 2x^2 + 4x + 7}{(x + 2)^4}     
  = a + \frac{b}{x + 2} + \frac{c}{(x + 2)^2} 
      + \frac{d}{(x + 2)^3} + \frac{e}{(x + 2)^4} \, ,\]then what is the value of $ a + b + c + d + e$?

Determine the number of integers $x$ such that $0\le x< 12$ and $x$ satisfies the following system of equations: \begin{align*}
&x-1\equiv 1-x\pmod {12},\\
&x-2\equiv 2-x\pmod{12}.
\end{align*}

If \[f(x) =
\begin{cases}
x^2-4 &\quad \text{if } x \ge -4, \\
x + 3 &\quad \text{otherwise},
\end{cases}
\]then for how many values of $x$ is $f(f(x)) = 5$?

Let  \[f(x) =
\begin{cases}
k(x) &\text{if }x>2, \\
2+(x-2)^2&\text{if }x\leq2.
\end{cases}
\]Find the function $k(x)$ such that $f$ is its own inverse.

For some constants $a$ and $b,$ let \[f(x) = \left\{
\begin{array}{cl}
ax + b & \text{if } x < 2, \\
8 - 3x & \text{if } x \ge 2.
\end{array}
\right.\]The function $f$ has the property that $f(f(x)) = x$ for all $x.$ What is $a + b?$

The function defined by
\[f(x) = \left\{
\begin{array}{cl}
x + k & \text{if $x < 4$}, \\
2x - 3 & \text{if $x \ge 4$}
\end{array}
\right.\]has an inverse, and the inverse is defined for all real numbers.  Enter all possible values of $k,$ separated by commas.

Determine the number of integers $x$ such that $0\le x< 12$ and $x$ satisfies the following system of equations: \begin{align*}
&x-1\equiv 1-x\pmod {12},\\
&x-2\equiv 2-x\pmod{12}.
\end{align*}

For some constants $a$ and $b,$ let \[f(x) = \left\{
\begin{array}{cl}
9 - 2x & \text{if } x \le 3, \\
ax + b & \text{if } x > 3.
\end{array}
\right.\]The function $f$ has the property that $f(f(x)) = x$ for all $x.$ What is $a + b?$

For how many positive integral values of $a$ is it true that $x = 2$ is the only positive integer solution of the system of inequalities $$
\begin{cases}
2x>3x-3\\
3x-a>-6
\end{cases}
$$
